-- Views
DROP VIEW IF EXISTS `active_bookings`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `active_bookings` AS select `bookings_with_details`.`id` AS `id`,`bookings_with_details`.`title` AS `title`,`bookings_with_details`.`description` AS `description`,`bookings_with_details`.`booking_date` AS `booking_date`,`bookings_with_details`.`start_time` AS `start_time`,`bookings_with_details`.`end_time` AS `end_time`,`bookings_with_details`.`place_id` AS `place_id`,`bookings_with_details`.`place_name` AS `place_name`,`bookings_with_details`.`status` AS `status`,`bookings_with_details`.`responsible_person_name` AS `responsible_person_name`,`bookings_with_details`.`responsible_person_email` AS `responsible_person_email`,`bookings_with_details`.`total_participants` AS `total_participants`,`bookings_with_details`.`internal_participants` AS `internal_participants`,`bookings_with_details`.`external_participants` AS `external_participants`,`bookings_with_details`.`refreshments_required` AS `refreshments_required`,`bookings_with_details`.`created_at` AS `created_at`,`bookings_with_details`.`created_by` AS `created_by`,`bookings_with_details`.`current_place_name` AS `current_place_name`,`bookings_with_details`.`place_city` AS `place_city`,`bookings_with_details`.`place_type` AS `place_type`,`bookings_with_details`.`place_capacity` AS `place_capacity`,`bookings_with_details`.`place_is_active` AS `place_is_active`,`bookings_with_details`.`place_start_time` AS `place_start_time`,`bookings_with_details`.`place_end_time` AS `place_end_time`,`bookings_with_details`.`place_allow_bookings` AS `place_allow_bookings`,`bookings_with_details`.`time_range` AS `time_range`,`bookings_with_details`.`duration` AS `duration`,`bookings_with_details`.`day_of_week` AS `day_of_week` from `bookings_with_details` where `bookings_with_details`.`booking_date` = curdate() and `bookings_with_details`.`status` = 'in_progress' and curtime() between `bookings_with_details`.`start_time` and `bookings_with_details`.`end_time`;

DROP VIEW IF EXISTS `active_places`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `active_places` AS select `places`.`id` AS `id`,`places`.`name` AS `name`,`places`.`description` AS `description`,`places`.`address` AS `address`,`places`.`city` AS `city`,`places`.`state` AS `state`,`places`.`country` AS `country`,`places`.`place_type` AS `place_type`,`places`.`capacity` AS `capacity`,`places`.`area_sqft` AS `area_sqft`,`places`.`phone` AS `phone`,`places`.`email` AS `email`,`places`.`created_at` AS `created_at` from `places` where `places`.`is_active` = 1;

DROP VIEW IF EXISTS `bookings_with_details`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `bookings_with_details` AS select `b`.`id` AS `id`,`b`.`title` AS `title`,`b`.`description` AS `description`,`b`.`booking_date` AS `booking_date`,`b`.`start_time` AS `start_time`,`b`.`end_time` AS `end_time`,`b`.`place_id` AS `place_id`,`b`.`place_name` AS `place_name`,`b`.`status` AS `status`,`b`.`responsible_person_name` AS `responsible_person_name`,`b`.`responsible_person_email` AS `responsible_person_email`,`b`.`total_participants` AS `total_participants`,`b`.`internal_participants` AS `internal_participants`,`b`.`external_participants` AS `external_participants`,`b`.`refreshments_required` AS `refreshments_required`,`b`.`created_at` AS `created_at`,`b`.`created_by` AS `created_by`,`p`.`name` AS `current_place_name`,`p`.`city` AS `place_city`,`p`.`place_type` AS `place_type`,`p`.`capacity` AS `place_capacity`,`p`.`is_active` AS `place_is_active`,`pc`.`start_time` AS `place_start_time`,`pc`.`end_time` AS `place_end_time`,`pc`.`allow_bookings` AS `place_allow_bookings`,concat(date_format(`b`.`start_time`,'%h:%i %p'),' - ',date_format(`b`.`end_time`,'%h:%i %p')) AS `time_range`,timediff(`b`.`end_time`,`b`.`start_time`) AS `duration`,dayname(`b`.`booking_date`) AS `day_of_week` from ((`bookings` `b` left join `places` `p` on(`b`.`place_id` collate utf8mb4_unicode_ci = `p`.`id` collate utf8mb4_unicode_ci)) left join `place_configuration` `pc` on(`p`.`id` collate utf8mb4_unicode_ci = `pc`.`place_id` collate utf8mb4_unicode_ci)) where `b`.`is_deleted` = 0;

DROP VIEW IF EXISTS `todays_bookings`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `todays_bookings` AS select `bookings_with_details`.`id` AS `id`,`bookings_with_details`.`title` AS `title`,`bookings_with_details`.`description` AS `description`,`bookings_with_details`.`booking_date` AS `booking_date`,`bookings_with_details`.`start_time` AS `start_time`,`bookings_with_details`.`end_time` AS `end_time`,`bookings_with_details`.`place_id` AS `place_id`,`bookings_with_details`.`place_name` AS `place_name`,`bookings_with_details`.`status` AS `status`,`bookings_with_details`.`responsible_person_name` AS `responsible_person_name`,`bookings_with_details`.`responsible_person_email` AS `responsible_person_email`,`bookings_with_details`.`total_participants` AS `total_participants`,`bookings_with_details`.`internal_participants` AS `internal_participants`,`bookings_with_details`.`external_participants` AS `external_participants`,`bookings_with_details`.`refreshments_required` AS `refreshments_required`,`bookings_with_details`.`created_at` AS `created_at`,`bookings_with_details`.`created_by` AS `created_by`,`bookings_with_details`.`current_place_name` AS `current_place_name`,`bookings_with_details`.`place_city` AS `place_city`,`bookings_with_details`.`place_type` AS `place_type`,`bookings_with_details`.`place_capacity` AS `place_capacity`,`bookings_with_details`.`place_is_active` AS `place_is_active`,`bookings_with_details`.`place_start_time` AS `place_start_time`,`bookings_with_details`.`place_end_time` AS `place_end_time`,`bookings_with_details`.`place_allow_bookings` AS `place_allow_bookings`,`bookings_with_details`.`time_range` AS `time_range`,`bookings_with_details`.`duration` AS `duration`,`bookings_with_details`.`day_of_week` AS `day_of_week` from `bookings_with_details` where `bookings_with_details`.`booking_date` = curdate() order by `bookings_with_details`.`start_time`;

DROP VIEW IF EXISTS `todays_visits`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `todays_visits` AS select `v`.`id` AS `id`,`v`.`visitor_id` AS `visitor_id`,`vis`.`first_name` AS `first_name`,`vis`.`last_name` AS `last_name`,`vis`.`company` AS `company`,`v`.`place_id` AS `place_id`,`p`.`name` AS `place_name`,`v`.`visit_purpose` AS `visit_purpose`,`v`.`host_name` AS `host_name`,`v`.`scheduled_start_time` AS `scheduled_start_time`,`v`.`scheduled_end_time` AS `scheduled_end_time`,`v`.`actual_start_time` AS `actual_start_time`,`v`.`actual_end_time` AS `actual_end_time`,`v`.`visit_status` AS `visit_status`,`v`.`check_in_time` AS `check_in_time`,`v`.`check_out_time` AS `check_out_time` from ((`visits` `v` join `visitors` `vis` on(`v`.`visitor_id` = `vis`.`id`)) join `places` `p` on(`v`.`place_id` = `p`.`id`)) where cast(`v`.`scheduled_start_time` as date) = curdate() order by `v`.`scheduled_start_time`;

DROP VIEW IF EXISTS `upcoming_bookings`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `upcoming_bookings` AS select `bookings_with_details`.`id` AS `id`,`bookings_with_details`.`title` AS `title`,`bookings_with_details`.`description` AS `description`,`bookings_with_details`.`booking_date` AS `booking_date`,`bookings_with_details`.`start_time` AS `start_time`,`bookings_with_details`.`end_time` AS `end_time`,`bookings_with_details`.`place_id` AS `place_id`,`bookings_with_details`.`place_name` AS `place_name`,`bookings_with_details`.`status` AS `status`,`bookings_with_details`.`responsible_person_name` AS `responsible_person_name`,`bookings_with_details`.`responsible_person_email` AS `responsible_person_email`,`bookings_with_details`.`total_participants` AS `total_participants`,`bookings_with_details`.`internal_participants` AS `internal_participants`,`bookings_with_details`.`external_participants` AS `external_participants`,`bookings_with_details`.`refreshments_required` AS `refreshments_required`,`bookings_with_details`.`created_at` AS `created_at`,`bookings_with_details`.`created_by` AS `created_by`,`bookings_with_details`.`current_place_name` AS `current_place_name`,`bookings_with_details`.`place_city` AS `place_city`,`bookings_with_details`.`place_type` AS `place_type`,`bookings_with_details`.`place_capacity` AS `place_capacity`,`bookings_with_details`.`place_is_active` AS `place_is_active`,`bookings_with_details`.`place_start_time` AS `place_start_time`,`bookings_with_details`.`place_end_time` AS `place_end_time`,`bookings_with_details`.`place_allow_bookings` AS `place_allow_bookings`,`bookings_with_details`.`time_range` AS `time_range`,`bookings_with_details`.`duration` AS `duration`,`bookings_with_details`.`day_of_week` AS `day_of_week` from `bookings_with_details` where `bookings_with_details`.`booking_date` >= curdate() and `bookings_with_details`.`status` not in ('cancelled','completed') order by `bookings_with_details`.`booking_date`,`bookings_with_details`.`start_time`;

DROP VIEW IF EXISTS `userprofile`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `userprofile` AS select `u`.`id` AS `id`,`u`.`email` AS `email`,concat(`p`.`first_name`,' ',`p`.`last_name`) AS `full_name`,`u`.`role` AS `role` from (`users` `u` left join `profiles` `p` on(`u`.`id` = `p`.`user_id`));

DROP VIEW IF EXISTS `v_active_external_members`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_active_external_members` AS select `external_members`.`id` AS `id`,`external_members`.`full_name` AS `full_name`,`external_members`.`email` AS `email`,`external_members`.`phone` AS `phone`,`external_members`.`company_name` AS `company_name`,`external_members`.`designation` AS `designation`,`external_members`.`visit_count` AS `visit_count`,`external_members`.`last_visit_date` AS `last_visit_date`,`external_members`.`created_at` AS `created_at` from `external_members` where `external_members`.`is_active` = 1 and `external_members`.`is_deleted` = 0 and `external_members`.`is_blacklisted` = 0 order by `external_members`.`full_name`;

DROP VIEW IF EXISTS `v_blacklisted_members`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_blacklisted_members` AS select `external_members`.`id` AS `id`,`external_members`.`full_name` AS `full_name`,`external_members`.`email` AS `email`,`external_members`.`phone` AS `phone`,`external_members`.`company_name` AS `company_name`,`external_members`.`blacklist_reason` AS `blacklist_reason`,`external_members`.`updated_at` AS `blacklisted_at` from `external_members` where `external_members`.`is_blacklisted` = 1 and `external_members`.`is_deleted` = 0 order by `external_members`.`updated_at` desc;

DROP VIEW IF EXISTS `v_member_statistics`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_member_statistics` AS select `external_members`.`company_name` AS `company_name`,count(0) AS `total_members`,sum(`external_members`.`visit_count`) AS `total_visits`,max(`external_members`.`last_visit_date`) AS `last_visit`,avg(`external_members`.`visit_count`) AS `avg_visits_per_member` from `external_members` where `external_members`.`is_active` = 1 and `external_members`.`is_deleted` = 0 and `external_members`.`is_blacklisted` = 0 group by `external_members`.`company_name` order by count(0) desc;

DROP VIEW IF EXISTS `v_pass_type_statistics`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_pass_type_statistics` AS select `pt`.`id` AS `pass_type_id`,`pt`.`name` AS `pass_type_name`,`pt`.`prefix` AS `prefix`,`pt`.`min_number` AS `min_number`,`pt`.`max_number` AS `max_number`,`pt`.`total_passes` AS `total_passes`,`pt`.`color` AS `color`,`pt`.`is_active` AS `is_active`,count(`p`.`id`) AS `total_created_passes`,sum(case when `p`.`status` = 'available' and `p`.`is_deleted` = 0 then 1 else 0 end) AS `available_count`,sum(case when `p`.`status` = 'assigned' and `p`.`is_deleted` = 0 then 1 else 0 end) AS `assigned_count`,round(sum(case when `p`.`status` = 'assigned' and `p`.`is_deleted` = 0 then 1 else 0 end) * 100.0 / nullif(count(`p`.`id`),0),2) AS `utilization_percentage` from (`pass_types` `pt` left join `passes` `p` on(`pt`.`id` = `p`.`pass_type_id`)) where `pt`.`is_deleted` = 0 group by `pt`.`id`;

DROP VIEW IF EXISTS `v_todays_visitors`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_todays_visitors` AS select `em`.`id` AS `member_id`,`em`.`full_name` AS `visitor_name`,`em`.`email` AS `visitor_email`,`em`.`phone` AS `visitor_phone`,`em`.`company_name` AS `visitor_company`,`em`.`designation` AS `visitor_designation`,`em`.`reference_type` AS `reference_type`,`em`.`reference_value` AS `reference_value`,`em`.`address` AS `address`,`em`.`city` AS `city`,`em`.`country` AS `country`,`em`.`is_blacklisted` AS `is_blacklisted`,`em`.`blacklist_reason` AS `blacklist_reason`,`em`.`visit_count` AS `visit_count`,`em`.`last_visit_date` AS `last_visit_date`,`em`.`notes` AS `visitor_notes`,`b`.`id` AS `booking_id`,`b`.`booking_ref_id` AS `booking_ref_id`,`b`.`title` AS `booking_title`,`b`.`description` AS `booking_description`,`b`.`booking_date` AS `booking_date`,`b`.`start_time` AS `start_time`,`b`.`end_time` AS `end_time`,`b`.`status` AS `booking_status`,`p`.`id` AS `place_id`,`p`.`name` AS `place_name`,`p`.`address` AS `place_address`,`p`.`city` AS `place_city`,`u`.`id` AS `responsible_person_id`,`u`.`email` AS `responsible_person_email`,time_format(`b`.`start_time`,'%h:%i %p') AS `start_time_formatted`,time_format(`b`.`end_time`,'%h:%i %p') AS `end_time_formatted`,concat(time_format(`b`.`start_time`,'%h:%i %p'),' - ',time_format(`b`.`end_time`,'%h:%i %p')) AS `time_slot`,case when `b`.`status` = 'cancelled' then 'cancelled' when `b`.`status` = 'completed' then 'completed' when `b`.`booking_date` < curdate() then 'missed' when `b`.`booking_date` = curdate() and curtime() between `b`.`start_time` and `b`.`end_time` then 'ongoing' when `b`.`booking_date` = curdate() and curtime() < `b`.`start_time` then 'upcoming' else 'upcoming' end AS `current_status`,case when `b`.`booking_date` = curdate() and curtime() < `b`.`start_time` then concat('In ',timestampdiff(MINUTE,curtime(),`b`.`start_time`),' mins') when `b`.`booking_date` = curdate() and curtime() between `b`.`start_time` and `b`.`end_time` then concat('Started ',timestampdiff(MINUTE,`b`.`start_time`,curtime()),' mins ago') when `b`.`booking_date` = curdate() and curtime() > `b`.`end_time` then concat('Ended ',timestampdiff(MINUTE,`b`.`end_time`,curtime()),' mins ago') else NULL end AS `time_status`,timestampdiff(MINUTE,`b`.`start_time`,`b`.`end_time`) AS `duration_minutes`,`ep`.`created_at` AS `participant_added_at`,`b`.`created_at` AS `booking_created_at` from ((((`external_participants` `ep` join `external_members` `em` on(`ep`.`member_id` = `em`.`id`)) join `bookings` `b` on(`ep`.`booking_id` = `b`.`id`)) left join `places` `p` on(`p`.`id` collate utf8mb4_unicode_ci = `b`.`place_id`)) left join `users` `u` on(`u`.`email` collate utf8mb4_unicode_ci = `b`.`responsible_person_email`)) where cast(`b`.`booking_date` as date) = curdate() and `ep`.`is_deleted` = 0 and `em`.`is_deleted` = 0 and `b`.`is_deleted` = 0 and `em`.`is_active` = 1 order by `b`.`start_time`,`em`.`full_name`;

DROP VIEW IF EXISTS `v_todays_visitors_by_hour`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_todays_visitors_by_hour` AS select hour(`b`.`start_time`) AS `hour_slot`,concat(lpad(hour(`b`.`start_time`),2,'0'),':00 - ',lpad(hour(`b`.`start_time`) + 1,2,'0'),':00') AS `time_range`,count(distinct `em`.`id`) AS `unique_visitors`,count(distinct `b`.`id`) AS `total_bookings`,sum(case when `b`.`status` = 'pending' then 1 else 0 end) AS `pending`,sum(case when `b`.`status` = 'completed' then 1 else 0 end) AS `completed`,group_concat(distinct `p`.`name` order by `p`.`name` ASC separator ', ') AS `places` from (((`bookings` `b` join `external_participants` `ep` on(`b`.`id` = `ep`.`booking_id`)) join `external_members` `em` on(`ep`.`member_id` = `em`.`id`)) left join `places` `p` on(`p`.`id` collate utf8mb4_unicode_ci = `b`.`place_id`)) where cast(`b`.`booking_date` as date) = curdate() and `ep`.`is_deleted` = 0 and `em`.`is_deleted` = 0 and `b`.`is_deleted` = 0 group by hour(`b`.`start_time`) order by hour(`b`.`start_time`);

DROP VIEW IF EXISTS `v_todays_visitors_by_place`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_todays_visitors_by_place` AS select `p`.`id` AS `place_id`,`p`.`name` AS `place_name`,`p`.`city` AS `place_city`,count(distinct `em`.`id`) AS `unique_visitors`,count(distinct `b`.`id`) AS `total_bookings`,sum(case when `b`.`booking_date` = curdate() and curtime() between `b`.`start_time` and `b`.`end_time` and `b`.`status` = 'pending' then 1 else 0 end) AS `currently_active`,sum(case when `b`.`booking_date` = curdate() and curtime() < `b`.`start_time` and `b`.`status` not in ('cancelled','completed') then 1 else 0 end) AS `expected_arrivals`,min(`b`.`start_time`) AS `first_visit_time`,max(`b`.`end_time`) AS `last_visit_time`,group_concat(distinct `em`.`full_name` order by `b`.`start_time` ASC separator ', ') AS `visitor_names` from (((`bookings` `b` join `external_participants` `ep` on(`b`.`id` = `ep`.`booking_id`)) join `external_members` `em` on(`ep`.`member_id` = `em`.`id`)) join `places` `p` on(`p`.`id` collate utf8mb4_unicode_ci = `b`.`place_id`)) where cast(`b`.`booking_date` as date) = curdate() and `ep`.`is_deleted` = 0 and `em`.`is_deleted` = 0 and `b`.`is_deleted` = 0 group by `p`.`id`,`p`.`name`,`p`.`city` order by min(`b`.`start_time`);

DROP VIEW IF EXISTS `v_todays_visitors_summary`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_todays_visitors_summary` AS select curdate() AS `report_date`,count(distinct `em`.`id`) AS `total_unique_visitors`,count(distinct `b`.`id`) AS `total_bookings`,count(0) AS `total_visitor_entries`,sum(case when `b`.`status` = 'pending' then 1 else 0 end) AS `pending_count`,sum(case when `b`.`status` = 'completed' then 1 else 0 end) AS `completed_count`,sum(case when `b`.`status` = 'cancelled' then 1 else 0 end) AS `cancelled_count`,count(distinct `em`.`company_name`) AS `total_companies`,sum(case when `em`.`is_blacklisted` = 1 then 1 else 0 end) AS `blacklisted_visitors_count`,min(`b`.`start_time`) AS `earliest_visit`,max(`b`.`end_time`) AS `latest_visit`,sum(case when `em`.`visit_count` >= 10 then 1 else 0 end) AS `frequent_visitors_count` from ((`external_participants` `ep` join `external_members` `em` on(`ep`.`member_id` = `em`.`id`)) join `bookings` `b` on(`ep`.`booking_id` = `b`.`id`)) where cast(`b`.`booking_date` as date) = curdate() and `ep`.`is_deleted` = 0 and `em`.`is_deleted` = 0 and `b`.`is_deleted` = 0;

-- Stored Procedures
DROP PROCEDURE IF EXISTS `check_place_availability`;
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `check_place_availability`(
    IN p_place_id CHAR(36),
    IN p_booking_date DATE,
    IN p_start_time TIME,
    IN p_end_time TIME,
    OUT p_is_available BOOLEAN,
    OUT p_conflict_message VARCHAR(500)
)
BEGIN
    DECLARE v_day_of_week VARCHAR(20);
    DECLARE v_is_active BOOLEAN;
    DECLARE v_allow_bookings BOOLEAN;
    DECLARE v_day_available BOOLEAN;
    DECLARE v_config_start TIME;
    DECLARE v_config_end TIME;
    DECLARE v_conflict_count INT;
    
    -- Get day of week
    SET v_day_of_week = LOWER(DAYNAME(p_booking_date));
    
    -- Check if place is active
    SELECT is_active INTO v_is_active 
    FROM places 
    WHERE id COLLATE utf8mb4_unicode_ci = p_place_id COLLATE utf8mb4_unicode_ci;
    IF v_is_active IS NULL OR v_is_active = FALSE THEN
        SET p_is_available = FALSE;
        SET p_conflict_message = 'Place is not active';
        SELECT p_is_available, p_conflict_message;
    ELSE
        -- Check configuration
        SELECT 
            allow_bookings,
            start_time,
            end_time,
            CASE v_day_of_week
                WHEN 'monday' THEN available_monday
                WHEN 'tuesday' THEN available_tuesday
                WHEN 'wednesday' THEN available_wednesday
                WHEN 'thursday' THEN available_thursday
                WHEN 'friday' THEN available_friday
                WHEN 'saturday' THEN available_saturday
                WHEN 'sunday' THEN available_sunday
            END
        INTO v_allow_bookings, v_config_start, v_config_end, v_day_available
        FROM place_configuration
        WHERE place_id COLLATE utf8mb4_unicode_ci = p_place_id COLLATE utf8mb4_unicode_ci;
        
        IF v_allow_bookings IS NULL OR v_allow_bookings = FALSE THEN
            SET p_is_available = FALSE;
            SET p_conflict_message = 'Bookings are not allowed for this place';
            SELECT p_is_available, p_conflict_message;
        ELSEIF v_day_available IS NULL OR v_day_available = FALSE THEN
            SET p_is_available = FALSE;
            SET p_conflict_message = CONCAT('Place is not available on ', DAYNAME(p_booking_date));
            SELECT p_is_available, p_conflict_message;
        ELSEIF p_start_time < v_config_start OR p_end_time > v_config_end THEN
            SET p_is_available = FALSE;
            SET p_conflict_message = CONCAT('Time must be between ', v_config_start, ' and ', v_config_end);
            SELECT p_is_available, p_conflict_message;
        ELSE
            -- Check for time conflicts with existing bookings
            SELECT COUNT(*) INTO v_conflict_count
            FROM bookings
            WHERE place_id COLLATE utf8mb4_unicode_ci = p_place_id COLLATE utf8mb4_unicode_ci
              AND booking_date = p_booking_date
              AND is_deleted = FALSE
              AND status NOT IN ('cancelled')
              AND (
                  (p_start_time >= start_time AND p_start_time < end_time) OR
                  (p_end_time > start_time AND p_end_time <= end_time) OR
                  (p_start_time <= start_time AND p_end_time >= end_time)
              );
            
            IF v_conflict_count > 0 THEN
                SET p_is_available = FALSE;
                SET p_conflict_message = 'This time slot conflicts with an existing booking';
                SELECT p_is_available, p_conflict_message;
            ELSE
                -- All checks passed
                SET p_is_available = TRUE;
                SET p_conflict_message = 'Place is available';
                SELECT p_is_available, p_conflict_message;
            END IF;
        END IF;
    END IF;
END$$
DELIMITER ;

DROP PROCEDURE IF EXISTS `sp_check_member_exists`;
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_check_member_exists`(
  IN p_email VARCHAR(255),
  IN p_phone VARCHAR(20),
  OUT p_exists TINYINT,
  OUT p_member_id CHAR(36)
)
BEGIN
  SELECT 
    CASE 
      WHEN COUNT(*) > 0 THEN 1 
      ELSE 0 
    END,
    MAX(`id`)
  INTO p_exists, p_member_id
  FROM `external_members`
  WHERE (`email` = p_email OR `phone` = p_phone)
    AND `is_deleted` = 0;
END$$
DELIMITER ;

DROP PROCEDURE IF EXISTS `sp_get_member_by_contact`;
DELIMITER $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_member_by_contact`(
  IN p_search VARCHAR(255)
)
BEGIN
  SELECT 
    `id`,
    `full_name`,
    `email`,
    `phone`,
    `company_name`,
    `designation`,
    `reference_type`,
    `reference_value`,
    `visit_count`,
    `is_blacklisted`,
    `blacklist_reason`
  FROM `external_members`
  WHERE (`email` LIKE CONCAT('%', p_search, '%') 
    OR `phone` LIKE CONCAT('%', p_search, '%')
    OR `full_name` LIKE CONCAT('%', p_search, '%'))
    AND `is_deleted` = 0
  LIMIT 10;
END$$
DELIMITER ;

-- Triggers
DROP TRIGGER IF EXISTS `trg_external_members_after_insert`;
DELIMITER $$
CREATE DEFINER=`root`@`localhost` TRIGGER `trg_external_members_after_insert`
AFTER INSERT ON `external_members`
FOR EACH ROW
BEGIN
    `id`,
    `member_id`,
    `action`,
    `reason`,
    `performed_by`,
    `performed_at`
  ) VALUES (
    UUID(),
    NEW.`id`,
    'created',
    'New member added',
    NEW.`created_by`,
    NOW()
  );
END$$
DELIMITER ;

DROP TRIGGER IF EXISTS `trg_external_members_after_update`;
DELIMITER $$
CREATE DEFINER=`root`@`localhost` TRIGGER `trg_external_members_after_update`
AFTER UPDATE ON `external_members`
FOR EACH ROW
BEGIN
  -- Log blacklist changes
  IF OLD.`is_blacklisted` != NEW.`is_blacklisted` THEN
      `id`,
      `member_id`,
      `action`,
      `field_name`,
      `old_value`,
      `new_value`,
      `reason`,
      `performed_by`,
      `performed_at`
    ) VALUES (
      UUID(),
      NEW.`id`,
      IF(NEW.`is_blacklisted` = 1, 'blacklisted', 'unblacklisted'),
      'is_blacklisted',
      OLD.`is_blacklisted`,
      NEW.`is_blacklisted`,
      NEW.`blacklist_reason`,
      NEW.`updated_by`,
      NOW()
    );
  END IF;
  
  -- Log general updates
  IF OLD.`updated_at` != NEW.`updated_at` THEN
      `id`,
      `member_id`,
      `action`,
      `performed_by`,
      `performed_at`
    ) VALUES (
      UUID(),
      NEW.`id`,
      'updated',
      NEW.`updated_by`,
      NOW()
    );
  END IF;
END$$
DELIMITER ;

